import axios from "axios"
import "./App.css";
import {BrowserRouter,Routes,Route} from "react-router-dom"
import Login from "./component/Login";




const login = () => {
return (
<>
<h1>Sign Up</h1>
<BrowserRouter>
    <Routes>
    <Route path="/login"element={<SignUp/>}/>
    </Routes>
    </BrowserRouter>
</>
)
}


export default SignUp
